INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (34418, 55, 'Acyclovir', 'Neurotoxicity Syndromes', 'Acyclovir, particularly when administered intravenously in higher dosages, may occasionally produce neurotoxicity characterized by lethargy, obtundation, tremors, confusion, hallucinations, agitation, seizures, or coma.  Therapy with acyclovir should be administered cautiously in the elderly and in patients with underlying neurologic abnormalities, severe renal or liver disease, or significant electrolyte abnormalities or hypoxia.', '2', '', 'DDInter', 0);
